window.bookSummaryJSON = "<p><b>Attention. Attention. The gates are down. The hunters are loose.</b></p> <p><b>Run, run, run. </b></p> <p>A lush jungle teeming with danger. Savage dinosaurs seeking blood. A fallen princess intent on vengeance. A mysterious, end-of-floor celebration for the top crawlers, dubbed “The Butcher’s Masquerade”.&nbsp;</p> <p>The sixth floor. The Hunting Grounds.</p> <p>As the remaining crawlers battle for their lives, a new, terrible threat looms. Outside, tourists are finally allowed to enter the game, and they are here and ready to hunt. Among them is Vrah, a famed and veteran hunter, intent on collecting the biggest trophy of her career.</p> <p>But their prey is far from harmless, and this season they are fighting back.</p> <p>Dungeon Crawler Carl and Princess Donut return in book five of the acclaimed LitRPG series.</p>"; 
